import React from "react";

export const ModalAccept = () => {

    return(
        <div className="modal-accept_block">
            <div className="modal-accept_box">
                <h2>You realy want delete?</h2>
                <div className="modal-accept_buttons">
                    <button className="modal-accept_btn">Yes</button>
                    <button className="modal-accept_btn">No</button>
                </div>
            </div>
        </div>
    )
}
